def find_function(x, y):
    # Create an empty list to store the function values
    function_values = []

    # Iterate over the given table
    for i in range(1, 4):
        # If the given x value is equal to the table x value, add the corresponding y value to the list
        if i == x:
            function_values.append(y)

    # If the list is empty, return None
    if len(function_values) == 0:
        return None

    # If the list has only one element, return the corresponding function
    if len(function_values) == 1:
        return function_values[0]

    # If the list has more than one element, return the corresponding function
    for i in range(1, 4):
        if i == x:
            return function_values[i-1]

